import React, { useState } from 'react';
import styled from 'styled-components';

const AddToDo = () => {
  const [todo, setTodo] = useState('');

  return (
    <form>
      <label>
        To-Do:
        <textarea value={setTodo} />
      </label>
      <input type="add" value="Add" />
    </form>
  );
};

export default AddToDo;
